import React from 'react'
import { Drawer, Typography } from '@mui/material'
import { makeStyles } from '@mui/styles';

const drawerrWidth = 240

const useStyles = makeStyles({
    page: {
        background: '#f9f9f9',
        width: '100%'
    }
})

export default function Layout({ children }){

    return(
        <div>
            <div>
                {children}
            </div>
        </div>
    );
}
